ga justru beresiko merusak gigi anda.<br /><br />Solusinya lebih baik gunakan TEETH TRAINER ! Merupakan alat yang lebih simple, murah dan yang terpenting aman dari pada behel gigi.<br /><br /><br />ORTHODONTIC TEETH TRAINER de sa USA (Original)<br /><br /><br />Teeth trainer ini terbuat dari \"Polyurethane\" semacam karet silicone yang nyaman dipakai di mulut dan tidak sakit, namun tetap bisa menciptakan tekanan yang mengarahkan gigi pada posisi ideal.<br /><br /><br /><br />Telah di riset oleh banyak pakar ortho/gigi dunia sehingga bentuk dan ukurannya telah di sesuaikan dengan bentuk gigi dan mulut.<br /><br /><br />Cukup cepat terlihat perbaikan asalkan rutin MULAI TERLIHAT DENGAN PEMAKAIAN MINIMAL 3-6 BULAN. Lebih baik lagi hingga 1 tahun. WORK &amp; SAFETY !<br /><br /><br /><br />BEKERJA OPTIMAL PADA :<br />1. Treating Malocclusion : Kelainan susunan bagian atas dan bawah rahang yg mencegah gigi bertemu dengan semestinya<br /><br />2. Mild to medium upper and lower Anterior Crowding : Memperbaiki pada kasus gigi berkurumun atas/bawah<br /><br />3. Treatment of Relapse of Anterior Alignment After Treatment with braces : Sebagai perawatan setelah pemakaian kawat gigi permanen<br /><br /><br />CARA PEMAKAIAN :<br /><br /><br />Pakai selama 1 - 2 jam setiap pagi/siang dan 8 jam dimalam hari saat tidur dan selalu ingat untuk mengikuti beberapa langkah sederhana ini :<br />1. Bibir didekap saat pemakaian kecuali ketika berbicara<br /><br />2. Bernapas melalui hidung untuk mencapai gigitan yang benar<br /><br />3. Jangan ada aktivitas bibir saat pemakaian<br /><br />4. Pada Minggu pertama akan terasa sakit, ini wajar, gunakan terus setiap hari. Biasanya baru akan nyaman setelah beberapa minggu pemakaian.<br /><br /><br />PERAWATAN :<br />Sebelum dan sesudah Pemakaian selalu sikat dengan sikat gigi, bisa menggunakan air dingin ataupun hangat. JANGAN GUNAKAN AIR PANAS ! Kemudian keringkan dan simpan kembali di kotaknya.</div>\r\n</div>',1000,699,'BD4444',0,0,1,'2023-03